import React, { Component } from "react";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";


class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
    // // const { projects } = this.props.projects;

    // let projectData = projects.sort().map(project => (
    //   <li className="project-listing" key={project._id}>
    //     <Link to={`/projects/${project._id}`}>{project.name}</Link>
    //   </li>
    // ));
    const { user } = this.props.auth;
    return (
      <div class="col-sm-3  sidebar">
          <div class="profile-sidebar">
            <div class="profile-userpic">
              <img src="http://placehold.it/50/231D4E/fff" class="img-responsive" alt=""/>
            </div>
            <div >
              <h6 style={{ marginBottom: "20px"}}>
                <center><b>Hello Admin,</b> {user.name.split(" ")[0]}</center>
                </h6>
              <div class="profile-usertitle-status"><span class=""></span>Online</div>
            </div>
            <div class="clear"></div>
          </div>
          <div class="divider"></div>
          
          <ul class="nav menu">
            <br/>
            <br/>
            <br/>
            <br/>
          <NavLink exact activeClassName="active-page" to="/dashboard">
             <center>Dashboard</center>
          </NavLink>
          <NavLink exact activeClassName="active-page" to="/dashboard">
             <center>Home</center>
          </NavLink>
          <NavLink exact activeClassName="active-page" to="/dashboard">
             <center>Investor Relation</center>
          </NavLink>
          <NavLink exact activeClassName="active-page" to="/dashboard">
             <center>Members</center>
          </NavLink>
          <NavLink exact activeClassName="active-page" to="/dashboard">
             <center>Downloadables</center>
          </NavLink>
          <div className="a" onClick={this.onLogoutClick}>
            <center>Logout</center>
          </div>
          </ul>
	      </div>
		
    );
  }
}

const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
